INSERT INTO `test_one_subtest_one` VALUES (110, '2121002025', 'segera saya berikan ke kantor pos', 'saya akan mengajak orang orang yang ada digedung ', 'karna kalau su', 'karna sudah kewajiban, karena digunakan keperluan pemerintah', 'karena sepatu membutuhkan kulit yang kuat saat dipakai', 'melihat arah matahari berjalan', 'bicara dengan baik baik', 'untuk mengatur tingkah laku manusia dan untuk keamanan dan keadilan', 'tujuannya agar air tidak menggenang ', 'karena perkawinan itu ibadah', 7);
INSERT INTO `test_one_subtest_one` VALUES (111, '2121002200', 'dikembaliakan kepada pemiliknya sesuai alamat yang ada di amplop', 'keluar dari bioskop dan mengambil alat pemadam yang biasanya terdapat didepan bioskop', 'karena kita sudah membuat janji maka harus ditepati jika tidak kita akan mengingkari dan tidak dipercaya oleh orang itu.', 'karena sebagai warga negara yang baik, kita harus menerapkan peraturan sesuai kebijakan pemerintah yaitu wajib membayar pajak. karena barang yang kita punya juga termasuk pajak yang har', 'karena sifat dari kulit sendiri elastis gampang dibentuk dan termasuk dalam kategori awet ketika dirubah menjadi barang seperti sepatu', 'jika saya tersesat didalam hutan pada siang hari, saya akan menggunakan kompas pada hp saya dan mengikuti arah matahari atau tanda jalan yang saya lewati sebelumnya', 'mungkin saya akan menolaknya dengan sopan, jika saya bisa mengusahakannya saya akan memberikan itu', 'hukum perlu untuk mentaatkan para masyarakat. jika tidak ada hukum bagaimana kondisi masyarakat itu sendiri. maka akan tidak terkontrol dan seenaknya sendiri', 'Agar tidak menyebabkan banjir dan bau yang menyengat serta tidak menimbulkan penyakit', 'karena jika tidak ada maka akan sering terjadinya perceraian yang tidak diinginkan', 12);
INSERT INTO `test_one_subtest_one` VALUES (112, '2121002003', 'menyerahkan kepada pihak pos untuk diantar ke alamat penerimanya', 'segera mengnformasikan kepada pihak bioskop yang berada di', 'karena janji merupakan pencerminan kepribadian dan konsistensi', 'karena sebuah kewajiban warga negara kepada negara/pemerintahan guna meningkatkan pembangunan dan fasum', 'lebih bagus kualitasnya dan tahan lama', 'melihat arah matahari terbit dan mengikuti alur sungai untuk enemukan jalan keluar', 'meminta maaf kepadanya dan menjelaskan tidak memiliki barang yang diinginkannya', 'untuk mengatur kehidupan dan aktivitas supaya berjalan dengan lancar dan sesuai norma', 'supaya tidak terjadi banjir ketika hujan tiba ', 'supaya norma perkawinan itu jelas adanya dan tidak sesuka hati sendiri terhadap perkawinan k', 14);
INSERT INTO `test_one_subtest_one` VALUES (113, '2121001992', 'saya akan mengirim amplop tersebut  ke tempat post terdekat', 'saya akan melaporkan ke petugas keamanan, dan mulai mengajak orang-orang untuk keluar dari gedung bioskop', 'karena, ibaratnya janji adalah sebuah hutangbyang harus dibayar', 'karena dengan membayar pajak kita akan membantu untuk membangun instruktur dan frakstruktur negara', 'karena, kulit itu bahannya kuat dan tidak mudah robek', 'saya akan mengikuti arah matahari dan mencari arah angin maupun air', 'saya akan berusaha untuk memenuhinya dan jika tidak dapat saya akan meminta maaf ', 'karena hukum dapat menata perilaku dan tingkah seseorang, hukum juga mengatur dan bersifat memaksa agar orah mematuhinya', 'karena bila tidak mengalir dapat menimbulkan kebanjiran maupun menjadi wabah penyakit', 'agar terbentuk suatu keluarga yang bahagia dan damai', 12);
INSERT INTO `test_one_subtest_one` VALUES (114, '2121001943', 'mencari alamat tersebt dan mengembalikan amplop tersebut kepada pemiliknya', 'segera mencari bantuan, memberi tahu orang-orang yan', 'karena janji adalah sebuah amanah yang wajib di lakukan sesuai dengan apa yang sudah di ucapkan', 'karena merupakan sebuah kewajiban yang sudah di tetapkan dan wajib di patuhi jika pajak itu sesui dengan prosedurnya', 'karena kulit merupakan bahan yang kuat, tidak mudah rusak, dan memiliki nilai jual dan kualitas yang tinggi', 'mengikuti arah matahri apabila tidak membawa alat petunjuk arah seperti kompas maupun telepon untuk menghubungi orang lain guna meminta bantuan', 'menjelaskan dengan baik bahwa tidak memiliki sesuatu tersebut, apabila mampu, maka akan berusaha membantu mencarinya', 'karena hukum merupakan ketetapan yang sudah di tentukan oleh pemerintah. hukum bersifat wajib, dan tidak bisa di ganggu gugat', 'agar tidak menimbulkan penyumbatan sehingga menyebabkan air d selokan tersebut terhambat aliranya. dan apabila terhambat maka bisa menimbulkan banjir pada saat hujan turun', 'karena apabila tidak di tetapkan uud, maka akan ada pernikahan legal yang tidak sesuai dengan aturan. seperti pernikahan dini dn lain-lain', 10);
INSERT INTO `test_one_subtest_one` VALUES (115, '2121002052', 'diambil dan diberi ke yang punya', 'berusaha untuk keluar dari gedung ', 'karena  kalau tidak ditepati itu dosa  ', 'karena sudah menjadi aturan negara dan sudah menjadi kewajiban kita', 'karena agar tampilan menarik dan awet ', 'saya harus tetap tenang supaya bisa menulusuri jalan tanpa berpikir negatif', 'saya akan berusaha untuk memberikan yang dia ingin', 'perlu ,karena hukum termasuk dalam hak setiap manusia ', 'karena kalau tidak mengalir berarti airnya mati atau tidak digunakan', 'karena setiap manusia diwajibkan untuk berpasangan ', 3);
INSERT INTO `test_one_subtest_one` VALUES (116, '2121002041', 'Saya akan mengantar dan mengembalikan amplop tersebut ke alamat yang tertulis. Karena amplop tersebut bukan bagian dari milik saya.', 'Saya akan melaporkan kejadian tersebut kepada pihak yang berwenang. Dikarenakan saya menjadi saksi dari aksi para pelaku yang menimbulkan kebakaran di bioskop tersebut.', 'Karena janji merupakan suatu pertanggung jawaban kita sebgai manusia yang mengatakan. Dimana sesuatu yang kita ikat dengan omongan janji, maka harus segera ditepati. ', 'Karena membayar pajak merupakan kewajiban kita sebagai warga negara untuk membayarnya. Dengan pajak ini pun negara dapat menambah anggaran untuk pembangunan nasional.', 'Karena kulit memiliki kualitas yang bagus untuk digunakan sebagai bahan sepatu. Tidak hanya sepatu saja, kulit memiliki kualitas bahan yang baik untuk digunakan sebagai bahan pembuatan tas maupun jaket. Karena efek yang dihasilkan oleh bahan dapat awet.', 'Saya akan mencari jalan sesuai dengan arah matahari ada. Dimana dengan melihat matahari saya bisa melihat arah jelas. Selain itu, jika saya membawa kompas. Maka saya akan menggunakan kompas tersebut untuk keluar dari hutan.', 'Saya akan mengatakan minta maaf dikarenakan apa yang saudara saya minta tidak saya punyai dan menyuruh meminta pertolongan kepada yang lain.', 'Hukum menjadi hakikat suatu negara untuk mengontrol atau mengatur perilaku yang bersifat negatif dan tidak sesuai aturan. Dengan adanya hukum ini pula akan tercipta lingkungan yang nyaman tanpa ada penyimpangan.', 'Dikarenakan parit memiliki fungsi sebagai pengairan yang luas untuk mengairi beberapa tempat. Adanya part ini juga berfungsi untuk melancarkan area parit yang tersumbat', 'Dikarenakan perkawinan memiliki efek positif dan juga efek negatif jika perkawinan tersebut dilakukan oleh banyak orang di usia muda. Oleh karena itu, dengan adanya pembatasan pernikahan atau minimal pernikahan itu adalah hal yang bagus.', 9);
INSERT INTO `test_one_subtest_one` VALUES (117, '2121002060', 'saya akan mengembalkan amplop tersebut sesuai dengan alamat yang tertera', 'saya akan melaporkan ke petugas bioskop jika terjadi kebakaran di teater bioskop tersebut', 'karena menurut saya janji itu sangat penting dan janji merupakan sebuah hutang jikta tidak ditepati bisa dibawa hingga akhirat nantinya jadi sangatlah penting', 'karena membayar pajak juga sebagai kewajiban bagi seluruh warga negara indonesia dan itu merupakan kontrobusi kita terhadap negara', 'karena mungkin jika dibuat dari kulit lebih tahan lama , mudah dibersihkan , dan banyak menarik peminat pembeli', 'saya akan melihat kompas menunjukkan arah mata angin kemana jika tidak bisa melihat kompas saya menggunakan arah bayangan yang seperti ', 'saya akan berusaha menjelaskan jika saya tidak memiliki itu tetapi jika itu sangat penting dan sangat dibutuhkan saya akan mengusahakannya', 'sangat perlu karena jika tidak ada hukum semua orang akan tidak teratur an berantakan dan tidak akan memiliki peraturan', 'jika tidak mengalir akan menimbulkan bau tidak sedap sehingga akan menimbulkan penyakit', 'jika tidak ada akan terjadi perkawinan bebas , perkawinan dini yg akan menimbulkan keributan rumah tangga', 10);
INSERT INTO `test_one_subtest_one` VALUES (118, '2121001978', 'mengembalikan ke alamat yg tertera', 'memberitahu kepada petugas bioskop yang sedang berjaga didalam ruangan', ' maka akan membuat orang tidak percaya', 'karna itu merupakan kewajiban kita sebagai warga negara ', 'kuat disegala kondisi,tidak mudah rusak', 'mecarari phon atau bebatuan yang berlumut untuk menentukan ', 'menolaknya', 'agar orang orang tidak berbuat semena mena ', 'agar tidak menimbulkan bibit penyakit', 'agar masyarakat tidak seenaknya dalam m', 8);
INSERT INTO `test_one_subtest_one` VALUES (119, '2121001922', 'diberikan ke alamat yang telah tersedia', 'berteriak dan mengatakan ada kebakaran', 'karena kita telah memberikan harapan kepada orang yang dijanjikan', 'untuk membantu per', 'agar kuat, bagus, tahan air', 'berjalan terus mencari pemukiman karena keadaan masih terang', 'bilang kepada dia kalau saya tidak punya, tetapi sebelumnya saya akan mengusahakan dapat membantu terlebih dahulu', 'untuk menjadikan masyarakat menjadi tertib, damai, dan taat terhadap aturan', 'agar tidak terjadi banjir', 'agar tidak membludaknya perkawinan yang menyalahi aturan/tidak semestinya', 7);
INSERT INTO `test_one_subtest_one` VALUES (120, '2121002192', 'memberikan amplop kepada alamat yang tertera', 'melaporkan kepada orang sekitar serta memada', 'karena janji adalah hutang', 'karena pajak diperlukan untuk jalannya proyek', 'karena kulit merupakan bahan yang bagus, kuat praktis, dan mudah didapat', 'kembali ke jalan arah berangkat ', 'berkata sejujurnya bahwa saya tidak punya', 'karena dengan adanya hukum, semua dapat terarah dengan baik', 'karena air tersebut dapat mengurangi resiko banjir terjadi', 'karena dengan adanya UU perkawinan. perkawinan akan resmi dan sah', 5);
INSERT INTO `test_one_subtest_one` VALUES (121, '2121002165', 'saya akan mengantar amplop tersebut ke alamat yang tertera diamplop itu.', 'keluar dari bioskop dan melaporkan ke petugas yang ada', 'karena janji itu adalah sebuah tanggung jawab yang sudah kita sanggupi sebelumnya.bentuk r', 'pajak adalah sebuah tanggung jawab yang haru dibayarkan setiap orang sebaga bentuk kontribusi ke pemerintah.', 'karena kulit cenderung kuat dan memiliki nilai estetika tersendiri bagi yang memakai sehingga bisa terlihat elegan dan mewah', 'mengikuti arah matahari berada sebagai panduan ', 'mengatakan kepada saudara saya jika saya tidak mempunyai apa yang dia minta dengan baik tapi tetap akan berusaha membantunya', 'hukum itu perlu karena agar memberi efek jera kepada pelaku pelanggaran agar tidak mengulanginya lagi', 'karena jika air di parit tidak mengalir bisa menyebabkan selokan tersumbat dan timbulnya banjir', 'bentuk upaya mencegah banyaknya pernikahan dini yang terjadi', 11);
INSERT INTO `test_one_subtest_one` VALUES (122, '2121001986', 'saya akan memberikannya ke kantor pos agar dapat dikembalikan kepada pemiliknya.', 'saya akan memberitahukan informasi kebakaran tersebut kepada petugas keamanan dan membantu mengevaluasi para penonton yang ada di dalam', 'karna janji merupakan tanggung jawab diri atas keputusan yang dibuat kepada orang lain yang harus ditepati.', 'karena sebagai warga negara kita tentu harus taat pada aturan negara yang mengharuskan kita bayar pajak untuk kas negara sebagai warga negara yang baik', 'karna sepatu darikulit itu bahannya bagus, tidak mudah koyak,kesannya elegan,dan nyaman digunakan ', 'saya akan menyalakan api untuk memberitahu lokasi saya kepada orang lain, sehingga mereka dapat menemukan saya dari asap api y', 'saya akan memberitahunya kalau saya tidak punya apa yang dia minta dan menyuruhnya mencari ke orang lain saja dengan', 'karna untuk mengatur dan memberi hukuman kepada ', 'karna parit merupakan air yang kotor, kalau tidak mengalir maka akan menimbulkan penyakit seperti nyamuk dbd dan lainnya', 'agar tidak adanya perwakinan diluar nikah dan agar perkawinan tersebut dapat terdata oleh pemerintah sebgai satu keluarga ', 11);
INSERT INTO `test_one_subtest_one` VALUES (123, '2121002048', 'mengantarkan amplop ke alamat tersebut', 'Memberitahu yang lain bahwa ada permulaan kebakaran di bioskop', 'karena janji merupakan suatu peristiwa yang disetujui oleh semua pihak dan harus ditepati sesuai kesepakatan', 'karena negara Indonesia mewajibkan pajak untuk negara', 'agar sama seperti kita berjalan tanpa alas, sebagai pelindung kaki yang pas, memberikan rasa nya,man', 'menancapkan ranting ke tanah dan lihat bayangan yang ditimbulkan', 'meminta maaf karena saya memang tidak memiliki hal tersebut dan membantu untuk mencarinya', 'karena jika tidak ada hukum maka seseorang akan melakukan semaunya sendiri tanpa rasa takut untuk melanggarnya', 'Karena air parit akan terus terbawa hingga ke sungai/laut jika terhambat maka timbul banjir ', 'Jika tidak adanya peraturan perkawinan maka sesorang akan gampang dalam melakukan menikah atau perceraian', 10);
INSERT INTO `test_one_subtest_one` VALUES (124, '2121002189', 'saya akan mengirim kembali amplop tersebut di alamat yang yang sudah tertera', 'saya akan keluar dari gedung tersebut dan sesegera mungkin menghubungi', 'sebab sebuah janji adalah hal yang harus ditepati oleh seseorang agar orang tersebut bisa memberi kepercayaan kepada kita', 'membantu negara, ', 'sebab jika terbuat dari kain sepatu itu mudah sobek dan juga warnanya pun mudah pudar', 'ketika saya berada didalam hutan saya akan membawa biji kacang, dan biji kacang tersebut lah yang akan saya jadikan sebuah tanda untuk kembali ketempat semula', 'sebelumnya saya akan meminta maaf terlebih dahulu jika saya tidak bisa memberi apa yang beliau minta, namun jika saya bisa mencarinya', 'sebuah rakyat akan semena semena, jika ada hukum mereka akan berusaha untuk mentaatinya', 'jika air itu berhenti makan parit itu pun akan ', 'jika tidak ada undang undang maka pernikahan dini pun akan terjadi seperti zaman dahulu dan akan ', 7);
INSERT INTO `test_one_subtest_one` VALUES (125, '2121001871', 'megantarkan kembali ke pemiliknya atau mengembalikan ke kantor pos', 'melaporkan kepada petugas yang berada di dekat bioskop ', 'karena janji adalah utang, dan jika janji kita tidak di tepati kita dapat membuat seseorang kecewa', 'karena pajak yang di bayar untuk membangun kota dan kita mendapatkan fasilitas yang memadai ', 'karena bahanya awet, bagus untuk digunakan,', 'menggunakan hp untuk mengghubungi seseorang dan berteriak sekencang mungkin', 'meminta maaf dan berusaha mencari jalan keluarnya bersam', 'karena jika tidak ada hukum keadaan akan menjadi kacau dan tidak terkendali', 'agar tidak terjadi peluapan air yang dapat menyebabkan banjir pada musim hujan', 'karena agar menjadi keluarga yang sah ', 10);
INSERT INTO `test_one_subtest_one` VALUES (126, '2121001919', 'akan mengembalikan ke pemilih yang beralamat diamplop', 'akan berteriak dan meminta tolong petugas bioskop.jika terjadinya kecil akan saya matikan sendiri', 'karena janji adalah cerminan diri', 'karena kita sebagai warga negara yang baik kita harus membayar pajak demi kelangsungan negara', 'karena yang berbahan dasar kulit biasanya lebih awet saat digunakan', 'berteriak meminta tolong agar warga sekitar mendengar dan mencari pemukiman warga ', 'berusaha memberi jika berusaha tersebut belum membuahkan hasil kita mem', 'karena dasar negara addlah pancasila yang mana didalamnya terdapat hukum yang berlaku,keadilan bagi', 'karena jika tersumbat akan menyebabkan banjir dan bau yang tak sedap', 'karena jika perkawinan di usia dini akan banyak faktor negatif contohnya jika dia sudah hamil anak nya kemungkinan besar akan keguguran ', 7);
INSERT INTO `test_one_subtest_one` VALUES (127, '2121001925', 'mengembalikannya kepada pemilik, dengan cara mengantarkan ke sesuai alamat yang jelas tersebut', 'lari keluar dari gedung bioskop, supaya ', 'karena janji adalah hutang', 'supaya negara kita menjadi makmur at', 'karena sepatu yang terbuat dari kulit itu tahan lama, dan mudah untuk digunakan', 'dengan mengikuti arah dimana matahari itu berada', 'saya akan berusaha memberikan yang terbaik untuk saudara karib saya', 'supaya menimbulkan efek jera kepada orang yang melanggar peraturan', 'supaya tidak terjadi bencana banjir akibat dari air selokan yang tersumbat', 'supaya tidak ada perkawinan yang tidak sah ', 8);
INSERT INTO `test_one_subtest_one` VALUES (128, '2121001917', 'mengantarkan amplop itu ke alamat yang tertulis atau memberikan pada polisi untuk menindaklanjutinya', 'memberi tahu kepada pihak yang terkait untuk menjadi saksi dalam kejadian itu', 'karena janji sama seperti hutang,jika kita berhtang sebaiknya kita mengembalikannya begitu juga dengan janji harus kita tepati, agar orang juga selalu perc', 'karena membayar pajak merupakan kewajiban semua warga negara, karena hal tersebut digunakan negara untuk keperlua', 'karena bahannya lebih awet dan gampang untuk dibersihkan', '', '', '', '', '', 3);
INSERT INTO `test_one_subtest_one` VALUES (129, '2121002196', 'pastinya jelas saya akan mencari alamat tsb & memberikanyya kepada orang yg memiliki amplop tsb', 'jika saya mempunyai nomor pemadam kebakaran maka pertaama saya menghubungi dulu lalu baru saya memberitahu yg lain kalau ada musibah kebakaran', 'karena janji sama halnya dengan hutang jika mash punya janji dan org tsb tdk ikhlas mk akan di pertaggungjawabkan di akhirat nanti,jadi harus hati-ha', 'karena kita hidup di bumi ini juga sebenarnya tidak gratis lagipula kita disuruh membayar pajak nantinya hasilnya juga untuk kita sendiri ja', 'agar tahan air kalau terbuat dari kain maka kita yang pakai akan risih dan tidak kuat kalau kulit pastinya kita juga nyaman dan kuat', 'kalau hp masih ada koneksi sinyal maka saya akan cari petunjuk maps kalau nggk sya searching tentang peta hutan tsb mungkin saya akan menc', 'jika kita tidak punya kita jujur dgn kalimat yg baik kalau tudak punya,kalau kita punya uang setidaknya belikanlah karena kita mampu utk men', 'kalau tidak ada hukum mk semua tidak akan terurus dengan baik,bnyak yg tidak mematuhi aturan& berbuat seenaknya sendiri ', 'karena pada dasarnya terkadang selokan bukan air bersih,terkadang mengalir juga butuh karena agar bisa sampai ke sumbernya ', 'karena jika tdk ada uud tsb maka semua orang pasti tudak melakukan aturan dengan baik lagipula perkawinan juga di bahas dalam masalah islam fiqih', 6);
INSERT INTO `test_one_subtest_one` VALUES (130, '2121001906', 'saya akan mengembalikan amplop tersebut ke alamat yang tertera di amplop tersebut', 'saya akan berteriak kepada semua orang untuk evakuasi agar segera meninggalkan gedung tersebut, apabila ada yang terjatuh akan saya tolong agar bisa segera meninggalkan tempat', 'agar dapat dioercaya orang, karena jika janji tidak ditepati maka orang tidak akan percaya lagi kepada kita', 'karena pajak pada dasarnya adalah kewajiban seluruh rakyat yang berada dalam negara tersebut, dan itu sudah diatur oleh negara dalam undang undang', 'karena bahan dasar kulit bersifat lebih awet dan tahan air, dan juga bahan dasar kulit memiliki nilai yang tinggi.', 'akan menggunakan kompas, jika tidak ada menggunakan arah bayangan dari matahari dan juga menggunakan kelembapan pada pohon ', 'saya akan dengan jujur berkata jika tipak punya sesuatu tersebut, dan menyarankan untuk mencari di e commerce atau toko', 'perlu, karena hukum bersifat mutlak, jika orang bersalah tidak dihukum, mereka akan mengulangi kesalahan tersebut, tetapi jika dihukum, mereka akan jera dan memikirkan lagi ', 'agar dapat mengalir ke sawah dan tidak menimbulkan endapan, jika ada endapan maka suatu saat bila hujan akan terjadi banjir.', 'agar hal tersebut bisa menjadi acuan untuk kawin, bila seseorang tidak menggunakan itu maka bisa terjadi salah gunaan', 8);
INSERT INTO `test_one_subtest_one` VALUES (131, '2121002040', 'memeriksa alamat yang dituju dan nama penerima dan pengirim   ', 'memberitahu orang- orang sekitar adanya kebakaran di sekitar dan  menyuruh untuk langsung evakuasi', 'karena dihukum islam mengingkari janji itu berdosa dan saya tidak ingin orang yang saya janjikan sakit hati karena saya mengingkari janji mereka', 'karena itu merupakan kewajiban kami sebagai warga negara yang berbaktii', 'karena tahan lama dan sudah merupakan trend sejak dulu ', 'berjalan mengikuti kompas yang saya bawa atau panggil 911', 'saya akan bilang bahwa saya tidak mempunyai barang tersebut tapi mungkin saya bisa membelikannya', 'bila tidak ada hukum, dunia akan tertib dan berantahkan ', 'karena bila tidak mengalir berarti ada yang menghalangi jalan air parit mengalir', 'agar terkoorperasi ', 5);
INSERT INTO `test_one_subtest_one` VALUES (132, '2121002023', 'Akan saya kembalikan kepada pemiliknya karena itu bukan hak saya da.', 'saya akan langsung memberitahu semua orang yang ada disitu dan petugas bioskop agar segera ditangani.', 'karena itu merupakan sikap yang harus di amalkan oleh setiap orang agar selalu di percayai banyak orang.', 'dengan kita membayar pajak maka kita ikut serta dalam membangun suatu kota bahkan negara kita sendiri.', 'agar sepatu tahan lama atau awet dan dipakai itu nyaman.', 'saya akan melihat arah kemana matahari itu terbenam untuk menemukan jalan keluar.', 'saya akan mengucapkan minta maaf karena memang benar benar saya tidak mempunyai apa yang dia minta.', 'hukum memang perlu untuk mengatur setiap kegiatan yang ada di negara agar negara aman, tentram dan harmonis', 'karena jika air diparit tersumbat maka akan banyak penyakit yang bersarang disitu', 'agar tidak ada ora yang berbuat macam macam tanpa adanya perkawinan.', 8);
INSERT INTO `test_one_subtest_one` VALUES (133, '2121002198', 'menyimpan dahulu, kemudian pergi ke kantor ', 'berteriak, berlari, memberi tahu petugas. memadamkan sementara dgn makanan bioskop', 'seperti hutang. akan terus dimintai pertanggung jawaban hingga di akhirat', 'bentuk kewajiban untuk membayar atas sarana dan prasarana yang pemerintah sediakan', 'bahan yang paling fleksibel saat dibuat dan digunakan. paling mudah dibuat, nyaman, awet, dan murah', 'menaiki pohon dan mencari pemukiman/warga yg ramai', 'memberitahu apa adanya. jika memungkin unuk mencari/mkembeli benda tersebut akan saya antar', 'layaknya peraturan. akan kacau jika semua berbuat seenaknya tanpa adanya peraturan/hukum', 'jika tidak akan menguap, dan meluber di pemukiman warga. air juga perlu berproses unuk menjadi bagian air yang lain', 'tanpa uu perkawinan, angka ibu hamil di luar nikah akan melambung. juga rawan resiko untuk anak kurang perhatian. juga agar orang tua tanggungjawab', 8);
INSERT INTO `test_one_subtest_one` VALUES (134, '2121001981', 'saya akan mengirimkan amplop tersebut ke alamat yag ada pada amplop tanpa membuka amplop tersebut', 'saya akan berteriak keluar memberitahu mengunjung atau orang-orang yang ada disana agar segera keluar untuk mencari tempat yang', 'karena janji adalah sebuah amanah yang harus kita tepati atau sampaikan seperti yang diajarkan oleh agama kita.', 'karena itu merupakan kewajiban kita sebagai warga negara yang baik untuk mengikuti aturan yang sudah dibuat pemerintah', 'karena kulit merupakan bahan baku yang awet dan tahan usang sehingga membuat jangka pemakaian sepatu lebih lama dan tidak mudah rusak', 'dengan membuat kompas atau dengan mengikuti arah matahari atau bisa juga mengikuti aliran sungai apabia', 'saya akan mengakatan dengan baik-baik bahwa saya tidak bisa memenuhi apa yan', 'karena apabila tidak ada aturan yang mengikat kita semua kekacuan akan terjadi dan kejahatan ada dimana-mana', 'supaya aliran air tidak menggenang dan terjadi pengembangbiakan nyamuk serta dapat menimbulkan bau yang tidak sedab', 'agar tidak terjadi pelecehan kepada wanita serta hal-hal negatif di luar perwakinan', 10);
INSERT INTO `test_one_subtest_one` VALUES (135, '2121001945', 'saya akan mencari alamat dari pemilik amplop tersebut dan memberikan amplop kepada pemiliknya ', 'saya akan mencari cara untuk memadamkan api tersebut namun jika tidak bisa saya akan memanggil pihak dae', 'dikarenakan janji adalah hutang dan sebuah kesepakatan kita terhadap seseorang jadi harus ditepati agar orang yang kita janjikan tidak kecewa ', 'dikarenakan pajak berguna bagi negara kita untuk pembangunan negeri yang lebih baik lagi ', 'karena sepatu yang terbuat dari kulit memiliki nilai jual yang tinggi dan tingkat kenyamanan yang baik untuk digu', 'saya akan mencari sebuah jalan keluar atau mencari seseorang yang paham akan hutan tersebut ', 'saya akan berusaha untuk membantu saudara karib saya sebelum saya berbicara kepada saudara saya bahwa sayab ', 'hukum perlu dikarenakan hukum mengatur dan bersifat memaksa sehiingga orang orang yang tau akan hukum akan menjadi orang yang tertib dan tidak melanggar aturan hukum ', 'jika air seloka tidak mengalir endapan dari selokan tersebut akan menyebabkan berbagai macam penyakit dan bencana alam seperti banjiir ', 'dikarenakan untuk mengatur jumlah perkawinan dan usia perkawinan agar semua teraratur dan tidak terjadi perkawinan dini ', 6);
INSERT INTO `test_one_subtest_one` VALUES (136, '2121001991', 'membaca alamat tersebut dan mengembalikan amplop yang berada dijalan', 'memberikan suara yang keras untuk menginformasikan kebakaran dan langsung menuju temp', 'karena sebuah tanggung jawab yang harus dijalani dan ', 'sebagai warga negara yang baik akan hukum dan suatu rasa cinta kita terhadap negri', 'menjaga kenyamanan pengguna, kuat dan praktis', 'melihat kompas bila ada dan menggunakan arah dari munculnya matahari menggunakan peta', 'memberikan alasan bahwa saya tidak memiliki barang tersebut ', 'agar suatu negara ataupun masyarakat bsa hidup berdampingan dan rukun serta memberikan efek takut dalam melakukan tindak ', 'mencegah banjir, sebaga tempat resapan selain pohon ', 'memberikan status kepada orang yang menikah, mencegah / menghtung tngkat kelahiran', 10);
INSERT INTO `test_one_subtest_one` VALUES (137, '2121001918', 'Saya akan menggembalikan kepada pemiliknya,namun saya akan bertanya kembali apakah ini benar amplop anda yang hilang', 'Saya akan segera menginformasikannya kepada pengunjung yang lain lalu memberi tahukan kepada petugas bioskop', 'Karena janji itu sama seperti hutang dan hutang tidak baik untuk dibawa mati,agar disenangi oleh ', 'Karena kita warga negara Indonesia yang memiliki kesadaraan untuk negara ini', 'Karena bahan kulit nyaman untuk dipakai melakukan aktivitas sehari-hari ', 'Saya akan mengikuti cahaya matahari sebagai petunjuk arah dan lebih cepat berlari untuk mengikutinya agar tidak gelap ', 'Saya akan mengusahakan segala sesuatu untuk bisa mendapatkan barang/apapun itu agar saudara saya bahagia tanpa mementingkan saya terlebih dahulu', 'Sangat perlu karena dengan adanya hukum manusia akan terbiasa dengan aturan agar tidak semena mena', 'Agar tidak terjadi pencemaran air dikawasan ramai', '', 7);

